import classes from "./PokemonList.module.css"
import React, {useState, useEffect} from 'react';

const PokemonList =  (props) => {
  const {pokemonData} = props
  // console.log(props.pokemonData && props.pokemonData.results)
//  console.log(props.pokemonArt)
  return(
     <div className={classes.grid}>
      {pokemonData?.map((pokemon) =>(
        <div className={classes.card}>
          <div className={classes.pokeimg}>
          <img src={pokemon.spritePokemon}/>
          </div>
            <div className={classes.poketext}>
              <p>{pokemon.namePokemon}</p>
              <p>{pokemon.descriptionPokemon}</p>
              <button className={classes.addbutton}>Add to Team</button>
            </div>
        </div>
      ))}
    </div>

  )
}

export default PokemonList;
